import { useEffect } from 'react';

function App() {

  let state = {
    pieces: '',
    colors: '',
    whites_turn: true
  };

  useEffect(() => {
    fetch('http://127.0.0.1:5555/moves')
      .then(r => r.json())
      .then(data => state = data)
  }, []);

  return (
    <h1>{state.pieces}</h1>
  );
}

export default App;
